import { useNavigate } from "react-router-dom";

export default function Header() {
    const navigate = useNavigate();

    function Navigate() {
        navigate(-1);
    }

    return (
        <>
            {window.location.pathname !== "/"
                ?
                <header className="header">
                    <p>CINEFLEX</p>
                </header>
                :
                <header className="header">
                    <p>CINEFLEX</p>
                    <h1>A Driven<br />Education<br />Project</h1>
                </header>
            }
        </>
    );
}
